import axios from 'axios';

export function gitProfile(username){
    console.log(username);
    return (dispatch)=>{
        return axios.get(`GET /users/:${username}`)
        .then(response => {
            dispatch(response.data)
          })
        .catch(error => {
            throw(error);
          });
    }
}
